---starthtml---
<div class="main-wrapper">
  <section class="hero-section">
    <h1>Find Your Dream House with Us</h1>
    <img src="house-1.jpg" alt="House 1">
    <img src="house-2.jpg" alt="House 2">
    <img src="house-3.jpg" alt="House 3">
  </section>

  <section class="form-section">
    <h2>Enter your details to find a rental house:</h2>
    <form>
      <label for="name">Name:</label>
      <input type="text" id="name">

      <label for="email">Email:</label>
      <input type="email" id="email">

      <label for="location">Location:</label>
      <input type="text" id="location">

      <label for="budget">Budget:</label>
      <input type="number" id="budget">

      <button type="submit">Search</button>
    </form>
  </section>

  <section class="pricing-section">
    <h2>Our Pricing:</h2>
    <ul>
      <li>1 BHK: $500/month</li>
      <li>2 BHK: $800/month</li>
      <li>3 BHK: $1200/month</li>
    </ul>
  </section>

  <section class="contact-section">
    <h2>Contact Us:</h2>
    <p>Phone No.: 1234567890</p>
    <p>Address: 123 Main Street, City, State</p>
    <p>Email: info@rentalhousecompany.com</p>
  </section>

  <section class="founders-section">
    <h2>Our Founders:</h2>
    <div class="founder-profile">
      <img src="founder-1.jpg" alt="Founder 1">
      <h3>John Doe</h3>
      <p>CEO and Co-Founder</p>
    </div>
    <div class="founder-profile">
      <img src="founder-2.jpg" alt="Founder 2">
      <h3>Jane Smith</h3>
      <p>COO and Co-Founder</p>
    </div>
  </section>
</div>
---endhtml---

---startcss---
.main-wrapper {
  max-width: 1200px;
  margin: 0 auto;
}

.hero-section {
  text-align: center;
}

.hero-section img {
  width: 30%;
  margin: 20px;
}

.form-section {
  text-align: center;
  margin: 50px 0;
}

form {
  display: inline-block;
  text-align: left;
}

label, input {
  display: block;
  margin: 10px 0;
}

button {
  padding: 10px 20px;
  background-color: #007bff;
  color: #fff;
  border: none;
  border-radius: 4px;
  cursor: pointer;
}

button:hover {
  background-color: #0069d9;
}

.pricing-section {
  text-align: center;
  margin: 50px 0;
}

.pricing-section ul {
  list-style: none;
  margin: 0;
  padding: 0;
}

.pricing-section li {
  margin: 10px 0;
}

.contact-section {
  text-align: center;
  margin: 50px 0;
}

.contact-section p {
  margin: 10px 0;
}

.founders-section {
  text-align: center;
  margin: 50px 0;
}

.founder-profile {
  display: inline-block;
  margin: 10px;
}

.founder-profile img {
  width: 100%;
  border-radius: 50%;
}

.founder-profile h3 {
  margin: 10px 0;
}

.founder-profile p {
  margin: 5px 0;
  text-transform: uppercase;
  font-weight: bold;
  color: #777;
}
---endcss---

